import React from 'react';

const Sidebar = () => {
  return (
    <div className="h-screen w-64 bg-white border-r border-gray-200 flex flex-col">
      <div className="flex items-center justify-center p-6 border-b border-gray-200">
        <div className="h-12 w-12 bg-green-500 rounded-full flex items-center justify-center text-white font-bold text-xl">
          K
        </div>
        <span className="ml-4 text-xl font-semibold text-green-500">KFUPM Clinic</span>
      </div>
      <nav className="flex-1 flex flex-col p-4 space-y-4">
        <div className="flex items-center w-full p-3 rounded-lg bg-green-500 text-white">
          Schedule Appointment
        </div>
        <div className="flex items-center w-full p-3 rounded-lg text-gray-700">
          Appointments
        </div>
      </nav>
    </div>
  );
};

export default Sidebar;
